    name:"cartSlice",
    reducers: {
        addToCart:(state,action) => {
            state.push(action.payload)
        },
        deleteFromCart:(state,action) => {},
        clear:(state,action) => {},
    },
})
export const {addToCart,deleteFromCart,clear}=cartSlice.actions;
